function getBirthday(day, month, year) {
	var res = "";
	for(var i =0; i<siswa['data'].length; i++) {
  	if(day == siswa['data'][i]['tanggallahir'].split(" ")[0] && month == siswa['data'][i]['tanggallahir'].split(" ")[1]) {
  		console.log("found birthday : " + siswa['data'][i]['nama']);
  		res+= siswa['data'][i]['nama'] + " - " + parseInt(year - siswa['data'][i]['tanggallahir'].split(" ")[2]) + " tahun " + "\n";
  	}
  }
  return res;
}

